<script setup lang="ts">
import Home from '../components/Home.vue'
import { ref } from 'vue'

interface Post {
  id: number
  title: string
  imageBase64: string
  tag: string[]
}

let id_temp = 0

const posts = ref<Post[]>([])

const swirlPost = ({
  id: 0,
  title: 'Swirl',
  imageBase64: 'data:image/jpeg;base64,',
  tag: ['', '', '', '', '', '']
})

const addSwirl = () => {
  let newPost = ({
    id: id_temp,
    title: swirlPost.title,
    imageBase64: swirlPost.imageBase64,
    tag: swirlPost.tag
  })
  posts.value.push(newPost)
  id_temp++
  console.log(posts.value)
}

const tags = ['', '', '', '', '', '', '1', '']

const newPostTitle = ref('')
const newPostImage = ref<File | null>(null)
const selectedTags = ref<string[]>([])

const onFileChange = (e: Event) => {
  const input = e.target as HTMLInputElement
  if (input.files && input.files[0]) {
    newPostImage.value = input.files[0]
  }
}

const toBase64 = (file: File) => {
  return new Promise<string>((resolve, reject) => {
    const reader = new FileReader();
    reader.readAsDataURL(file);
    reader.onload = () => resolve(reader.result as string);
    reader.onerror = (error) => reject(error);
  });
};

const addPost = async () => {
  if (!newPostTitle.value || !newPostImage.value || selectedTags.value.length === 0) return
  const imageBase64 = await toBase64(newPostImage.value)
  posts.value.push({
    id: id_temp,
    title: newPostTitle.value,
    imageBase64: imageBase64,
    tag: selectedTags.value
  })
  id_temp++
  newPostTitle.value = ''
  newPostImage.value = null
  selectedTags.value = []
  // console.log()
  console.log(posts.value)
}

const deletePost = (id: number) => {
  posts.value = posts.value.filter(post => post.id !== id)
}

</script>

<template>
  <div class="home">
    <Home />

    <input v-model="newPostTitle" placeholder="Title" />
    <input type="file" @change="onFileChange" />
    <div>
      <h3>Select Tag:</h3>
      <div v-for="tag in tags" :key="tag">
        <label>
          <input type="checkbox" :value="tag" v-model="selectedTags"/>
          {{ tag }}
        </label>
      </div>
    </div>

    <button @click="addPost()">Post</button>
    <button @click="addSwirl()">Swirl</button>
    
    <ul>
      <li v-for="post in posts" :key="post.id">
        <div class="title">
          <h1>Title: {{ post.title }}</h1>
          <button @click="deletePost(post.id)">Delete</button>
        </div>
        <div class="content" v-if="post.imageBase64">
          <h3>Content:</h3>
          <img :src="post.imageBase64" alt="Post image" style="max-width: 100%;" />
        </div>
        <div>
          <span v-for="tag in post.tag" :key="tag">
            <p class="tag">{{ tag }}</p>
          </span>
        </div>
      </li>
    </ul>
  </div>
</template>

